import * as actionTypes from '../actionTypes'

const initialState = { isLoggedIn: false }

export default (state = initialState, action) => {
  switch (action.type) {
    case actionTypes.TOGGLE_LOGGED_IN:
      return { ...state }
    default:
      return state
  }
}
